import React, { useState } from 'react';
import './faq.css';
import MyFaq from './MyFaq'
import { FaqQuestion } from './api';


const Faq = () => {
    const [data, setdata] = useState(FaqQuestion);
    
    return (
        <>
            <section className='main-div'>
                <h1>Our FAQ</h1>
                {
                    data.map((currElement) => {
                        const { id } = currElement;
                        return <MyFaq key={id} {...currElement} />;
                    })

                }
            </section>
        </>
    )
}

export default Faq
